INSERT INTO `trails` (`id`, `name`, `slug`, `desc`) VALUES(21, 'Gnojnice-Guberača', 'gnojnice-guberaca', 'Makadamski put kojim vodi ova ruta nije pretjerano grub i ni blizu onoga koji vodi na vrh Brasina. Takodjer, i krug koji se radi je znatno manji od onog kad je ukljucen i uspon na Brasinu. Ipak, da se zadovolje MTB apetiti, tu je dio uspona i najveci dio spusta koji vodi makadmskim putem, serpentima koje se spustaju prema gradu. Ipak, put mjestimicno zna biti jako rastresit pa time i tehnicki zahtjevan na spustu. Na ovoj dionici nema stalnih izvora vode pa se preporucuje nosenje dovoljne rezerve za cijelodnevnu voznju.');
INSERT INTO `trails` (`id`, `name`, `slug`, `desc`) VALUES(22, 'Mostar – Jasenica – Hum – Mostar', 'mostar-–-jasenica-–-hum-–-mostar', 'Kratku turu hercegovačkim kršom u okolici Mostara i posjetu dominantoj koti Humu iznad Mostara smo odabrali kao alternativu jednog kišnog oktobarskog dana. Kao i večinu vožnji po Hercegovini, i ovu preporučujemo za period ranog proljeća i kasne jeseni kad nema velikih vručina. Također, bitno je napomenuti da je tura vožena dijelom kroz krševitu draču punu trnja koje može biti kobno po gume pa savjetujemo bar dvije rezerven unutrašnje gume i obavezno set za krpljenje. Najbolja opcija su UST ili gume sa dobrom protekcijom od bušenja. Tura po konfiguraciji terena spada u lagane do srednje teške ture.');
